// @mui material components

import SuiTypography from "components/SuiTypography";
// import { Link } from 'react-router-dom';
// Soft UI Dashboard PRO React example components
import DashboardLayout from "examples/LayoutContainers/DashboardLayout";
import DashboardNavbar from "examples/Navbars/DashboardNavbar";
import Footer from "examples/Footer";

import { Table, Dropdown, Col } from 'react-bootstrap';
import { Link } from "react-router-dom";


function Cams() {
    return (
        <DashboardLayout>
            <DashboardNavbar />

            <br />

            <SuiTypography variant="h2" fontWeight="medium" style={{ textAlign: 'center', color: 'green' }}>

                My CAMS FUNDSNET Creds

            </SuiTypography>

            <hr style={{ color: 'red' }} />
            <br />

            <br />
            <Table striped bordered hover size="sm" style={{ textAlign: "center" }}>

                <tbody>
                    <tr>

                        <td style={{ padding: '15px' }}>Name</td>

                        <td>CAMS Fundsnet ID</td>

                        <td >Name</td>

                        <td>CAMS Fundsnet Password</td>

                        <td >CAMS Secret Qn Answer</td>

                        <td>Action</td>

                    </tr>

                    <tr>

                        <td style={{ padding: "10px" }}>Anuraag Saboo</td>
                        <td>ARGS</td>

                        <td>Cams@1234567</td>

                        <td>1</td>

                        <td>
                            <Link to={""} >Edit</Link>
                        </td>

                    </tr>
                </tbody>
            </Table>

            <Footer />
        </DashboardLayout>
    );
}

export default Cams;
